import styled from 'styled-components';
export const TrHover = styled.tr`
    transition: 0.3s;
    &:hover {
        background-color: ${props => props.row.solved ? "#43A047" : "rgb(229, 57, 53, 0.5)"};
        // rgb(250, 235, 215, 0.4);
        cursor: pointer;
    }
`
